define('text!views/fullBike.html',[],function () { return '<section>\r\n    <h2 class="page-title" data-bind="text: title"></h2>\r\n    <canvas id="bike" width="500" height="250" class="frame-canvas">\r\n        <p>Your browser doesn\'t support canvas.</p>\r\n    </canvas>\r\n    <div class="row-fluid" style="margin-top: 235px;">\r\n        <div class="span12" data-bind="with: frame">\r\n            <div class="row form-inline well well-small">\r\n                <h3>Frame:</h3>\r\n                <div class="span12">\r\n                    <div class="span4">\r\n                        <label class="control-label" for="manufacturer">Manufacturer:</label>\r\n                        <select class="input-medium" id="manufacturer" data-bind="options: $parent.manufacturers, optionsText: \'name\', value: manufacturer"></select>\r\n                    </div>\r\n                    <div class="span4">\r\n                        <label class="control-label" for="model">Model:</label>\r\n                        <select class="input-medium" id="model" data-bind="options: models, optionsText: \'name\', value: model"></select>\r\n                    </div>\r\n                    <div class="span4">\r\n                        <label class="control-label" for="size">Size:</label>\r\n                        <select class="input-medium" id="size" data-bind="options: sizes, optionsText: \'size\', value: size"></select>\r\n                    </div>\r\n                </div>\r\n            </div>\r\n            <div data-bind="with: size">\r\n                <div class="row">\r\n                    <div class="form-horizontal well well-small span6">\r\n                        <h3 class="text-center">Headset Information</h3>\r\n                        <div class="control-group">\r\n                            <label class="control-label" for="capHeight">Cap Height:</label>\r\n                            <div class="controls">\r\n                                <input class="input-mini" id="capHeight" data-bind="value: headSetTopCap" />\r\n                            </div>\r\n                        </div>\r\n                        <div class="control-group">\r\n                            <label class="control-label">Steerer Spacers:</label>\r\n                            <div class="controls">\r\n                                <input class="input-mini" data-bind="value: steeringSpacers" />\r\n                            </div>\r\n                        </div>\r\n                    </div>\r\n                    <div class="form-horizontal well well-small span6">\r\n                        <h3 class="text-center">Seat Information</h3>\r\n                        <div class="control-group">\r\n                            <label class="control-label">BB-Seat Distance:</label>\r\n                            <div class="controls">\r\n                                <input class="input-mini" data-bind="value: bbToSeatDistance" />\r\n                            </div>\r\n                        </div>\r\n                        <div class="control-group">\r\n                            <label class="control-label">Seat Tube Angle:</label>\r\n                            <div class="controls">\r\n                                <input class="input-mini" data-bind="value: seatTubeAngle" />\r\n                            </div>\r\n                        </div>\r\n                        <div class="control-group">\r\n                            <label class="control-label">Seat Length:</label>\r\n                            <div class="controls">\r\n                                <input class="input-mini" data-bind="value: seatLength" />\r\n                            </div>\r\n                        </div>\r\n                    </div>\r\n                </div>\r\n                <div class="row">\r\n                    <div class="form-horizontal well well-small span6">\r\n                        <h3 class="text-center">Stem Information</h3>\r\n                        <div class="control-group">\r\n                            <label class="control-label">Length:</label>\r\n                            <div class="controls">\r\n                                <input class="input-mini" data-bind="value: stemLength" />\r\n                            </div>\r\n                        </div>\r\n                        <div class="control-group">\r\n                            <label class="control-label">Angle:</label>\r\n                            <div class="controls">\r\n                                <input class="input-mini" data-bind="value: stemAngle" />\r\n                            </div>\r\n                        </div>\r\n                        <div class="control-group">\r\n                            <label class="control-label">Steerer Clamp Ht.:</label>\r\n                            <div class="controls">\r\n                                <input class="input-mini" data-bind="value: stemThickness" />\r\n                            </div>\r\n                        </div>\r\n                    </div>\r\n                    <div class="form-horizontal well well-small span6">\r\n                        <h3 class="text-center">Aero Bar Information</h3>\r\n                        <div class="control-group">\r\n                            <label class="control-label">Aero Bar Spacers:</label>\r\n                            <div class="controls">\r\n                                <input class="input-mini" data-bind="value: aeroBarSpacers" />\r\n                            </div>\r\n                        </div>\r\n                        <div class="control-group">\r\n                            <label class="control-label">Arm Pad Spacers:</label>\r\n                            <div class="controls">\r\n                                <input class="input-mini" data-bind="value: armPadSpacers" />\r\n                            </div>\r\n                        </div>\r\n                        <div class="control-group">\r\n                            <label class="control-label">Arm Pad Offset:</label>\r\n                            <div class="controls">\r\n                                <input class="input-mini" data-bind="value: armPadOffset" />\r\n                            </div>\r\n                        </div>\r\n                    </div>\r\n                </div>\r\n                <div class="row">\r\n                    <h3 class="text-center">Calculated Geometry</h3>\r\n                    <dl class="dl-horizontal">\r\n                        <dt>Frame Stack:</dt>\r\n                        <dd data-bind="text: stackFormatted"></dd>\r\n                        <dt>Frame Reach:</dt>\r\n                        <dd data-bind="text: reachFormatted"></dd>\r\n                        <dt>Pad Stack:</dt>\r\n                        <dd data-bind="text: padStack"></dd>\r\n                        <dt>Pad Reach:</dt>\r\n                        <dd data-bind="text: padReach"></dd>\r\n                    </dl>\r\n                </div>\r\n            </div>\r\n\r\n        </div>\r\n    </div>\r\n</section>\r\n';});


